import {
	BrowserRouter as Router,
	Routes as Switch,
	Route,
    Link
} from "react-router-dom";

const App = () => {
	return (
		<Router>
			<nav>
<ul> <Link>Home</Link>
</ul>
            </nav>
			<Switch>
				<Route path="/" element={<h1>Home</h1>} />
				<Route path="/people" element={<h1>People</h1>} />
			</Switch>
		</Router>
	);
};

export default App;
